import React from "react";

import User from "../../api/User";

export default class Users extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    User.get().then(({ data }) => {
      this.setState({
        users: data,
      });
    });
  }

  componentWillUnmount() {}

  render() {
    return <h3>Users</h3>;
  }
}
